\n\"title\": \"Status\",\r\n\"width\":100\r\n},\r\n\"cdate\":{\r\n\"title\":\"FIDA Upload Date\"\r\n}\r\n}\r\n}',6),(247843,2726,'IDCM Worker Supervisor Activity','{\r\n\"title\": \"IDCM Worker Supervisor Activity in the last 14 days\"\r\n,\"groupField\":\"idcm_worker\"\r\n,\"sql\": \"SELECT MAX(SUBTIME(r.next_actiontime, r.action_time)) inactive, r.action_date dates, CONCAT(users_groups.first_name, \' \', users_groups.last_name) idcm_worker, SUM(CASE WHEN r.action_type = \'create\' THEN 1 ELSE 0 END) AS \'Created\', SUM(CASE WHEN r.action_type = \'update\' THEN 1 ELSE 0 END) AS \'Updated\', SUM(CASE WHEN r.action_type = \'view\' THEN 1 ELSE 0 END) AS \'Viewed\'  FROM (SELECT r1.user_id, TIME(r1.action_time) as action_time, (SELECT TIME(r2.action_time) FROM action_log r2 WHERE TIME(r2.action_time) > TIME(r1.action_time) ORDER BY action_time ASC LIMIT 1) as next_actiontime, DATE(r1.action_time) action_date, r1.action_type FROM action_log as r1 WHERE DATE(r1.action_time) >= DATE(NOW()) + INTERVAL -14 DAY AND HOUR(r1.action_time) BETWEEN \'8\' AND \'18\' ORDER BY r1.action_time) as r, users_groups WHERE users_groups.id = r.user_id AND r.user_id in (select user_id from users_groups_association where group_id = 30) GROUP BY dates, idcm_worker\"\r\n,\"DC\":{\r\n        \"idcm_worker\": {\"title\":\"IDCM Worker Supervisor\", \"width\":150},\r\n        \"dates\": {\"title\":\"Date\", \"width\":100},\r\n        \"Created\": {\"title\":\"Records Created\", \"width\":150},\r\n        \"Updated\": {\"title\":\"Records Updated\", \"width\":150},\r\n        \"Viewed\": {\"title\":\"Records Viewed\", \"width\":150},\r\n        \"inactive\": {\"title\":\"Maximum Inactive Time\", \"width\":150}\r\n     }\r\n}',NULL),(247885,2726,'FEMA Referral Results','{\r\n\"title\": \"FEMA Referral Results\",\r\n\"sql\": \"SELECT b.,CONCAT(total_results,\':\',(select count() from rpt_referrals rds where je(sys_data, \"solr.resultname_s\') NOT LIKE \'N/A\' and ifnull(DATE(je(rds.sys_data, \"solr.result_dt\')), IFNULL(DATE(rds.udate), DATE(rds.cdate))) <= report_date )) totes FROM ( SELECT CONCAT( ifnull(DATE(je(a.sys_data, \"solr.result_dt\')), IFNULL(DATE(a.udate), DATE(a.cdate))), \'T00:00:00Z\') report_dt, DATE(ifnull(je(a.sys_data, \"solr.result_dt\'), IFNULL(a.udate, a.cdate))) report_date, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'Unmet\', 1, 0)) referral_unmet, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'N/A\', 1, 0)) referral_na, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'Information Only\', 1, 0)) referral_information_only, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'No Show\', 1, 0)) referral_noshow, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'Rejected\', 1, 0)) referral_rejected, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'Met-uninterested/refused\', 1, 0)) referral_refused, SUM(IF(je(a.sys_data, \"solr.resultname_s\') = \'Service Provided\', 1, 0)) referral_provided, SUM( IF( je(a.sys_data, \"solr.resultname_s\') = \'Unmet-resources not available\', 1, 0)) referral_not_available, SUM( IF(je(a.sys_data, \"solr.resultname_s\') = \'Met-service rendered\', 1, 0)) referral_met_service_rendered, SUM( IF(je(a.sys_data, \"solr.resultname_s\') NOT LIKE \'N/A\', 1, 0)) total_results, Count(*) - Sum(IF(je(a.sys_data, \"solr.resultname_s\') = \'Information Only\', 1, 0)) total_referrals, COUNT(je(c.sys_data, \'assessments_completed\')) information_only_assessments FROM rpt_referrals a, objects c WHERE a.cdate >= (DATE(NOW()) - INTERVAL 7 DAY) AND je(c.sys_data, \'case_status\') = \'Information Only\' GROUP BY CONCAT( ifnull(DATE(je(a.sys_data, \"solr.result_dt\')), IFNULL(DATE(a.udate), DATE(a.cdate))), \'T00:00:00Z\'), DATE(ifnull(je(a.sys_data, \"solr.result_dt\'), IFNULL(a.udate, a.cdate))) ) b \"\r\n,\"DC\": {\r\n\"report_dt\": {\r\n\"solr_column_name\": \"report_dt\",\r\n\"title\": \"Report Date\",\r\n\"type\": \"date\",\r\n\"width\": 100\r\n},\r\n\"total_results\": {\r\n\"solr_column_name\": \"total_results\",\r\n\"titl