ontime, DATE(r1.action_time) action_date, r1.action_type FROM action_log as r1 WHERE DATE(r1.action_time) >= DATE(NOW()) + INTERVAL -14 DAY AND HOUR(r1.action_time) BETWEEN \'8\' AND \'18\' ORDER BY r1.action_time) as r, users_groups WHERE users_groups.id = r.user_id AND r.user_id in (select user_id from users_groups_association where group_id = 576) GROUP BY dates, idcm_worker\"\r\n,\"DC\":{\r\n        \"idcm_worker\": {\"title\":\"IDCM Worker\", \"width\":150},\r\n        \"dates\": {\"title\":\"Date\", \"width\":150},\r\n        \"inactive\": {\"title\":\"Maximum Inactive Time\", \"width\":150},\r\n        \"Created\": {\"title\":\"Records Created\", \"width\":150},\r\n        \"Updated\": {\"title\":\"Records Updated\", \"width\":150},\r\n        \"Viewed\": {\"title\":\"Records Viewed\", \"width\":150}\r\n     }\r\n}',NULL),(248709,2726,'FIDA Stub Report','{\r\n\"title\": \"FIDA Stub Report\",\r\n\"groupField\": \"cdate\",\r\n\"query\": [\"template_id:246882\", \"dstatus:0\"],\r\n\"DC\": {\r\n\"id\": {\r\n\"solr_column_name\": \"id\",\r\n\"title\": \"FIDA ID\",\r\n\"width\":120\r\n},\r\n\"fidastatus_s\": {\r\n\"solr_column_name\": \"fidastatus_s\",\r\n\"title\": \"Status\",\r\n\"width\":200\r\n},\r\n\"fematier\": {\r\n\"solr_column_name\": \"fematier\",\r\n\"title\": \"FEMA Tier\",\r\n\"width\":175\r\n},\r\n\"outreachattemptdate_dt\": {\r\n\"solr_column_name\": \"outreachattemptdate_dt\",\r\n\"title\": \"Last Outreach Attempt\",\r\n\"width\":200\r\n},\r\n\"cdate\": {\r\n\"solr_column_name\": \"cdate\",\r\n\"title\": \"Upload Date\",\r\n\"width\":200\r\n}\r\n}\r\n}',NULL),(248711,2726,'FIDA Stub Summary','{\r\n\"title\": \"FEMA Total FIDA Stub Records\"\r\n,\"sql\": \"SELECT   CONCAT(DATE(cdate), \'T00:00:00Z\') as report_dt,    count(objects.id) AS total_fida,      SUM(CASE WHEN je(objects.sys_data, \'fidastatus_s\') = \'Open\' THEN 1 ELSE 0 END) AS fida_open, SUM(CASE WHEN je(objects.data, \'open_status\') = \'1579\' THEN 1 ELSE 0 END) AS fida_closed,      SUM(CASE WHEN je(objects.sys_data, \'fidastatus_s\') = \'Convert to ECMRS Record\' THEN 1 ELSE 0 END) AS fida_convert,      SUM(CASE WHEN je(objects.sys_data, \'fidastatus_s\') = \'Declined Services\' THEN 1 ELSE 0 END) AS fida_declined,      SUM(CASE WHEN je(objects.sys_data, \'fematier\') = \'Tier 1\' AND je(objects.sys_data, \'fidastatus_s\') = \'Convert to ECMRS Record\' THEN 1 ELSE 0 END) AS t1,      SUM(CASE WHEN je(objects.sys_data, \'fematier\') = \'Tier 2\' AND je(objects.sys_data, \'fidastatus_s\') = \'Convert to ECMRS Record\' THEN 1 ELSE 0 END) AS t2,      SUM(CASE WHEN je(objects.sys_data, \'fematier\') = \'Tier 3\' AND je(objects.sys_data, \'fidastatus_s\') = \'Convert to ECMRS Record\' THEN 1 ELSE 0 END) AS t3,      SUM(CASE WHEN je(objects.sys_data, \'fematier\') = \'Tier 4\' AND je(objects.sys_data, \'fidastatus_s\') = \'Convert to ECMRS Record\' THEN 1 ELSE 0 END) AS t4  FROM objects, tree  WHERE  objects.id = tree.id AND     objects.sys_data like \'%fidastatus_s%\' AND  (objects.sys_data LIKE \'%Open%\' OR       objects.sys_data LIKE \'%Convert to ECMRS Record%\' OR       objects.sys_data LIKE \'%Declined Services%\') GROUP BY CONCAT(DATE(cdate), \'T00:00:00Z\')\"\r\n,\"DC\":{\r\n\"report_dt\":{\"solr_column_name\":\"report_dt\",\"title\":\"report_date\",\"width\":60},\r\n\"total_fida\": {\"solr_column_name\":\"total_fida\",\"title\":\"Total FIDA Records\", \"width\":150},\r\n\"fida_open\": {\"solr_column_name\":\"fida_open\",\"title\":\"Total Open Records\", \"width\":150},\r\n\"fida_convert\": {\"solr_column_name\":\"fida_convert\",\"title\":\"Total Convert to ECMRS Records\", \"width\":150},\r\n\"fida_declined\": {\"solr_column_name\":\"fida_declined\",\"title\":\"Total Declined Services\", \"width\":150},\r\n\"fida_closed\": {\"solr_column_name\":\"fida_closed\",\"title\":\"Total Closed Records\", \"width\":150},\r\n\"t1\": {\"solr_column_name\":\"t1\",\"title\":\"Convert to ECMRS - Tier 1\", \"width\":150},\r\n\"t2\": {\"solr_column_name\":\"t2\",\"title\":\"Convert to ECMRS - Tier 2\", \"width\":150},\r\n\"t3\": {\"solr_column_name\":\"t3\",\"title\":\"Convert to ECMRS - Tier 3\", \"width\":150},\r\n\"t4\": {\"solr_column_name\":\"t4\",\"title\":\"Convert to ECMRS - Tier 4\", \"width\":150}\r\n}\r\n}',NULL),(249247,2726,'Task Report','{\r\n\"title\": \"FEMA Task Report\"\r\n,\"sql\": \"SELECT       CONCAT(DATE(cdate), \'T00:00:00Z\') AS report_dt,      CONCAT(ADDDATE(DATE(date_end), INTERVAL 1 DAY), \'T00:00:00Z\') odate,      COUNT(sys_data LIKE \'%overdue%\') as total_overdue,  SUM(CASE WHEN sys_data LIKE \'%overdue%\' AND je(data, \'importance\') = 57 THEN 1 ELSE 0 END) AS o_critical,      SUM(CASE WHEN sys_data LIKE \'%overdue%\' AND je(data, \'importance\') = 56 THEN 1 ELSE 0 END) AS o_high,      SUM(CASE WHEN sys_data LIKE \'%overdue%\' AND je(data, \'importance\') = 55 THEN 1 ELSE 0 END) AS o_med,      SUM(CASE WHEN sys_data LIKE \'%overdue%\' AND je(data, \'importance\') = 54 THEN 1 ELSE 0 END) AS o_low,      COUNT(sys_data like \'%task_status_s%\' and sys_data like \'%1906%\') as total_active,      SUM(CASE WHEN sys_data like \'%task_status_s%\' and sys_data like \'%1906%\' AND je(data, \'importance\') = 57 THEN 1 ELSE 0 END) AS a_critical,      SUM(CASE WHEN sys_data like \'%task_status_s%\' and sys_data like \'%1906%\' AND je(data, \'importance\') = 56 THEN 1 ELSE 0 END) AS a_high,      SUM(CASE WHEN sys_data like \'%task_status_s%\' and sys_data like \'%1906%\' AND je(data, \'importance\') = 55 THEN 1 ELSE 0 END) AS a_med,      SUM(CASE WHEN sys_data like \'%task_status_s%\' and sys_data like \'%1906%\' AND je(data, \'importance\') = 54 THEN 1 ELSE 0 END) AS a_low  FROM   objects, tree  WHERE   objects.id = tree.id AND      template_id = 7 AND      (sys_data LIKE \'%overdue%\' OR      (sys_data like \'%task_status_s%\' and sys_data like \'%1906%\'))  GROUP BY report_dt, odate; \"\r\n,\"DC\":{\r\n\"report_dt\":{\"solr_column_name\":\"report_dt\",\"title\":\"report_date\",\"width\":60},\r\n\"o_c