r\n,\"sql\": \"SELECT MAX(SUBTIME(r.next_actiontime, r.action_time)) inactive, r.action_date dates, CONCAT(users_groups.first_name, \' \', users_groups.last_name) intake_rep, SUM(CASE WHEN r.action_type = \'create\' THEN 1 ELSE 0 END) AS \'Created\', SUM(CASE WHEN r.action_type = \'update\' THEN 1 ELSE 0 END) AS \'Updated\', SUM(CASE WHEN r.action_type = \'view\' THEN 1 ELSE 0 END) AS \'Viewed\' FROM (SELECT r1.user_id, TIME(r1.action_time) as action_time, (SELECT TIME(r2.action_time) FROM action_log r2 WHERE TIME(r2.action_time) > TIME(r1.action_time) ORDER BY action_time ASC LIMIT 1) as next_actiontime, DATE(r1.action_time) action_date, r1.action_type FROM action_log as r1 WHERE DATE(r1.action_time) >= DATE(NOW()) + INTERVAL -14 DAY AND HOUR(r1.action_time) BETWEEN \'8\' AND \'18\' ORDER BY r1.action_time) as r, users_groups WHERE users_groups.id = r.user_id AND r.user_id in (select user_id from users_groups_association where group_id = 580) GROUP BY dates, intake_rep\"\r\n,\"DC\":{\r\n        \"intake_rep\": {\"title\":\"Intake Representative\", \"width\":150},\r\n        \"dates\": {\"title\":\"Date\", \"width\":150},\r\n        \"inactive\": {\"title\":\"Maximum Inactive Time\", \"width\":150},\r\n        \"Created\": {\"title\":\"Records Created\", \"width\":150},\r\n        \"Updated\": {\"title\":\"Records Updated\", \"width\":150},\r\n        \"Viewed\": {\"title\":\"Records Viewed\", \"width\":150}\r\n     }\r\n}',NULL);
