eport_date and sys_data not like \'%\\\\\\\"case_status\\\\\\\":\\\\\\\"Sólo información\\\\\\\"%\',1,0)) new_open_cases,   SUM(IF (DATE(c.cdate) = report_date,1,0)) client_intake,      SUM(IF (DATE(c.cdate) = report_date and sys_data like \'%\\\\\\\"case_status\\\\\\\":\\\\\\\"Sólo información\\\\\\\"%\',1,0)) information_only,      SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data not like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"Metas cumplidas\\\\\\\"%\',1,0)) closed_record_no_recovery_plan,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"Metas cumplidas\\\\\\\"%\',1,0)) closed_records_recovery_plan_complete,      SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"Metas parcialmente cumplidas, en transicion a otro proveedor de servicios%\',1,0)) closed_records_transitioning,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"Metas parcialmente cumplidas, recursos agotados\\\\\\\"%\',1,0)) closed_records_resources_exhaused,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"No se puede contactar cliente\\\\\\\"%\',1,0)) closed_records_no_longer_able_to_contact,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"Programa de desastre desactivado\\\\\\\"%\',1,0)) closed_records_deactivated,   SUM(IF (sys_data like CONCAT(\'%task_d_closed\\\\\\\":\\\\\\\"\',report_date,\'%\') and sys_data like \'%\\\\\\\"closurereason_s\\\\\\\":\\\\\\\"Cliente se ha retirado del manejo de caso\\\\\\\"%\',1,0)) closed_records_withdrawn,   SUM(IF (sys_data like CONC