tree.pid clientid,

je(objects.data, '_') locationregion,data, sys_data

from objects,tree where tree.id = objects.id and tree.template_id = 289 and tree.dstatus = 0 and data <> '[]';



create table rpt_addresses as

select tree.id addressid, 

je(objects.data, '_addressone') addressone,  

