 je(objects.data, '_lastname') lastname, 

  je(objects.data, 'assigned') assigned, 

   je(objects.data, '_gender') gender, 

   je(objects.sys_data, 'county_s') county_s,

    je(objects.sys_data, 'zipcode_s') zipcode_s,

   je(objects.sys_data, 'case_status') case_status,

   je(objects.sys_data, 'fematier') fema_tier,

   je(objects.data, '_fulladdress') fulladdress_s,

    je(objects.data, '_femanumber') femanumber,

      je(objects.data, 'at_risk_population') at_risk_population,

      je(objects.data,'_phonenumber') phonenumber,

        je(objects.sys_data, 'closurereason_s') closure_reason,    

      je(objects.sys_data, 'full_address') full_address,

      je(objects.sys_data, 'solr.locationother_s') locationother,

