    cdate, udate

    from objects, tree where tree.id = objects.id and dstatus = 0 

    and template_id = 141;

   

   

 create table rpt_referrals as

select objects.id referralid, je(objects.sys_data, 'solr.refferaltypename_s') refferaltype,  

je(objects.sys_data, 'solr.referralservicename_s') referralservice, 

 je(objects.sys_data, 'solr.resourcename_s') resourcename, 

